import { Bar } from 'react-chartjs-2';

const Barchart = () => {

    const data = {
        labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
        datasets: [
          {
            label: '# of Votes',
            data: [12, 19, 3, 5, 2, 3],
            backgroundColor: [
                '#0a156d',
                '#443889',
                '#6e5ea6',
                '#9786c3',
                '#bfb1e1',
                '#e8ddff',
            ],
            borderColor: [
              'rgba(255, 99, 132, 1)',
              'rgba(54, 162, 235, 1)',
              'rgba(255, 206, 86, 1)',
              'rgba(75, 192, 192, 1)',
              'rgba(153, 102, 255, 1)',
              'rgba(255, 159, 64, 1)',
            ],
            borderWidth: 1,
          },
        ],
      };

      const options = {
        scales: {
          yAxes: [
            {
              ticks: {
                beginAtZero: true,
              },
            },
          ],
        },
      };








    return(
    <div>
      <div className='header'>
        <h5 className='title'>Vertical Bar Chart</h5>
      </div>
      <Bar data={data} options={options} />
    </div>

  );
    }
  export default Barchart;
